import matplotlib.pyplot as plt
import matplotlib._cm
import numpy as np

def qrssVdToCsharp(cmap=colormap_blue):
    for i, item in enumerate(cmap):
        R, G, B = item
        print(f"pal.Entries[{i}] = Color.FromArgb(255, {R}, {G}, {B});")

def matplotlibToCsharp(cmap='viridis'):
    for i, frac in enumerate(np.arange(255)/255):
        cmap = matplotlib.cm.get_cmap('viridis')(frac)
        cmap = [int(x * 255) for x in cmap]
        R, G, B, A = cmap
        print(f"pal.Entries[{i}] = Color.FromArgb({A}, {R}, {G}, {B});")

if __name__ == "__main__":
    matplotlibToCsharp()
    print("DONE")
